// src/pages/ReportPet.jsx

import React, { useState, useEffect, Fragment } from 'react';
import api from '../api/axios';
import MapPicker from '../components/MapPicker';
import { useNavigate } from 'react-router-dom';

export default function ReportPet({ addToast, user }) {
  const [pets, setPets] = useState([]);
  const [form, setForm] = useState({
    type: 'lost', // 'lost' | 'found'
    pet_id: '',
    pet_name: '',
    description: '',
    happened_at: '',
    latitude: null,
    longitude: null,
    photo: null,
  });
  const navigate = useNavigate();

  // Cargar las mascotas del usuario
  useEffect(() => {
    if (user) {
      fetchPets();
    }
  }, [user]);

  const fetchPets = async () => {
    try {
      const res = await api.get('/api/pets');
      setPets(res.data);
    } catch {
      addToast('Error cargando tus mascotas', 'error');
    }
  };

  // Manejar cambios en el formulario
  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setForm((f) => ({
      ...f,
      [name]: name === 'photo' ? files[0] : value,
    }));
  };

  // Manejar mapa
  const handleMapChange = (lat, lng) => {
    setForm((f) => ({
      ...f,
      latitude: lat,
      longitude: lng,
    }));
  };

  // Manejar envío del formulario
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const fd = new FormData();
      Object.keys(form).forEach((key) => {
        if (form[key]) fd.append(key, form[key]);
      });

      await api.post('/api/lost-pets', fd);
      addToast('Reporte enviado correctamente', 'success');
      navigate('/lost-pets');
    } catch {
      addToast('Error al enviar el reporte', 'error');
    }
  };

  return (
    <Fragment>
      <h1 className="mb-4">Reportar Mascota</h1>
      <form onSubmit={handleSubmit} className="card p-4 mb-4">
        {/* Selección entre Mascota Perdida o Encontrada */}
        <select name="type" value={form.type} onChange={handleChange} className="form-select mb-3">
          <option value="lost">Reportar Mascota Perdida</option>
          <option value="found">Reportar Mascota Encontrada</option>
        </select>

        {/* Reportar Mascota Perdida */}
        {form.type === 'lost' ? (
          <select
            name="pet_id"
            value={form.pet_id}
            onChange={handleChange}
            className="form-select mb-3"
            required
          >
            <option value="">Selecciona tu mascota</option>
            {pets.map((pet) => (
              <option key={pet.id} value={pet.id}>
                {pet.name}
              </option>
            ))}
          </select>
        ) : (
          <input
            type="text"
            name="pet_name"
            className="form-control mb-3"
            placeholder="Nombre de la mascota encontrada"
            value={form.pet_name}
            onChange={handleChange}
            required
          />
        )}

        <textarea
          name="description"
          className="form-control mb-3"
          placeholder="Descripción del reporte"
          value={form.description}
          onChange={handleChange}
        />

        <input
          type="datetime-local"
          name="happened_at"
          className="form-control mb-3"
          value={form.happened_at}
          onChange={handleChange}
          required
        />

        {/* Mapa para seleccionar ubicación */}
        <div className="mb-3">
          <h5>Selecciona la ubicación:</h5>
          <MapPicker
            latitude={form.latitude}
            longitude={form.longitude}
            onChange={handleMapChange}
          />
        </div>

        {/* Subir Foto (Solo para mascotas encontradas) */}
        {form.type === 'found' && (
          <div className="mt-3 mb-3">
            <input type="file" name="photo" className="form-control" onChange={handleChange} />
          </div>
        )}

        <button type="submit" className="btn btn-primary">
          Enviar Reporte
        </button>
      </form>
    </Fragment>
  );
}
